import React, { Component } from 'react';

class DisplayQuantitiesAndTimes extends React.Component {
  constructor(props, context) {
    super(props, context);

  }
    render() {


      return (
        <div>
            Approx {(Math.round(this.props.baketime/60000))} for {(this.props.breadType)} minutes of this size <br/>
              Time of {(this.props.title)} rise is:  {(this.props.time[0])} mins.(that is about {(Math.round(this.props.time[0]/6)/10)} hours )<br/>
              Start at {(this.props.interfere[0])}, with a shape around {(this.props.interfere[1])} to achive the desired time in the {(this.props.title)}<br/>
        </div>
      );
    }
  }

  export default DisplayQuantitiesAndTimes;
